measurements.description:
Forty-five round, slightly cuppy flowers on four up to 97-cm upright inflorescences;
 sepals and petals ivory overlaid red-pink centrally, stronger along midline on petals;

lip ivory, midlobe widely barred burgundy, side lobes edged burgundy, callus golden yellow;
column white overlaid light burgundy, anther cap pale yellow; substance firm; texture matte; upgrade to award 20245272.
